import BookingPage from "./Components/BookingPage";
import { ChakraProvider } from "@chakra-ui/react";
import './App.css';
import HomePage from "./Components/HomePage";

function App() {
  return (
    <ChakraProvider>
      <HomePage />
      <BookingPage />
    </ChakraProvider>
  );
}

export default App;
